var doc = new jsPDF();
var button = document.getElementById("generatePDF");
button.addEventListener('click', printPDF);

function printPDF() {

    var imgData = 'data:image/png;base64,';
    doc.setFontSize(15);
    doc.addImage(imgData, 'PNG', 0, 0, 210, 290);

    doc.text(118, 91, document.getElementById("street_cars").value);
    doc.text(118, 107, document.getElementById("carshare").value);
    doc.text(118, 123, document.getElementById("percentage").value);
    doc.text(118, 138, document.getElementById("bikes").value);

    doc.text(178, 168, document.getElementById("gardens").value);
    doc.text(178, 185, document.getElementById("grow_food").value);
    doc.text(178, 194, document.getElementById("food_gardens").value);
    doc.text(85, 208, document.getElementById("veggie").value);

    doc.text(110, 240, document.getElementById("solar_panel").value);
    doc.text(110, 260, document.getElementById("roof").value);


    doc.save('Climate Change Detective Quest.pdf');
}
